import React from "react";
import "./meniu.css";

function Meniu({ closeMenu }) {
    return (
        <div className="meniu-overlay">
            <img className="logo" src="/nuotraukos/logo.png" alt="Logo" />
            <button className="close-x" onClick={closeMenu}>X</button> {/* Add the X button */}
            <div className="meniu-content">
                <h1>Apie mane</h1>
                <h2>Mano darbai</h2>
                <h3>
                    <span className="flower"><img className="gele_s" src="./nuotraukos/gelyte.png" alt="Logo" /></span> BENDRADARBIAUJAM?{" "}
                    <span className="flower"><img className="gele_s" src="./nuotraukos/gelyte.png" alt="Logo" /></span>
                </h3>
                <button className="close-button" onClick={closeMenu}>
                    Close
                </button>
            </div>
        </div>
    );
}

export default Meniu;
